mapper.select:
   SELECT DISTINCT
	JI.ID as id,
	JI.FINANCE_NO as financeNo,
	JI.MAIN_APPLY_NAME as mainApplyName,
	JI.APPLY_PRICE as applyPrice,
	JI.FINANCE_METHOD as financeMethod,
	JI.RIGHT_ADDR as rightAddr,
	JI.FINANCE_STATUS as financeStatus,
	CU.USER_NAME AS dealUserName,
	CU.USER_MOBILE AS dealUserPhone,
	JI.BROKER_USER_NAME as brokerUserName,
	JI.ARCHIVE_ID as archiveId,
	JI.CREATE_TIME as createTime,
	JI.BUILD_ID as buildId,
	JI.BUILD_NAME as buildName,
	JI.ERP_DEPT_ID as erpDeptId,
	JI.ERP_REG_ID as erpRegId,
	JI.VENDOR_NAME as vendorName,
	JI.DEAL_PRICE as dealPrice
FROM
	JR_FINANCE_INFO JI
LEFT JOIN FUN_DEPTS FD ON JI.COMP_NO = FD.COMP_NO
AND JI.DEPT_NO = FD.DEPT_NO
LEFT JOIN CRM_USER CU ON CU.USER_ID = JI.DEAL_USER_ID
WHERE
	JI.FINANCE_MODEL = '1'

		and JI.ERP_AREA_ID=#{areaId}


		and JI.ERP_REG_ID=#{areaId}


		and JI.ERP_DEPT_ID=#{deptId}


		and JI.ERP_GR_ID=#{grId}


		and JI.CREATE_TIME>=#{startTime}


		and JI.CREATE_TIME<=#{endTime}


		and JI.ARCHIVE_ID=#{archiveId}


		and JI.BUILD_NAME like #{buildName}


		and JI.MAIN_APPLY_NAME like #{loadUserName}


		and JI.FINANCE_STATUS IN ('8','7')


		and JI.FINANCE_STATUS = #{financeStatus}


		and JI.APPLY_PRICE >= #{priceMin}


		and JI.APPLY_PRICE <= #{priceMax}


		and JI.BUILD_ID IN

		#{buildId}


	AND (
		(
			JI.COMP_NO = #{compNo}
			AND JI.ERP_COMP_ID = #{compId}
		)
		OR (
			JI.SECOND_COMP_NO = #{compNo}
			AND JI.SECOND_DEPT_NO = #{deptNo}
		)
	)
	ORDER BY
		JI.ID DESC
